// InboxList.jsx
import React from 'react';
import { ListGroup } from 'react-bootstrap';

const InboxList = () => {
  // Contoh daftar inbox
  const inboxItems = [
    { id: 1, sender: 'john.doe@example.com', subject: 'Meeting Tomorrow' },
    { id: 2, sender: 'alice.smith@example.com', subject: 'Important Announcement' },
    // Tambahkan item inbox lainnya sesuai kebutuhan
  ];

  return (
    <div className="inbox-list">
      <h2>Inbox</h2>
      <ListGroup>
        {inboxItems.map((item) => (
          <ListGroup.Item key={item.id}>
            <strong>{item.sender}</strong>: {item.subject}
          </ListGroup.Item>
        ))}
      </ListGroup>
    </div>
  );
};

export default InboxList;
